package patterns;

public class Program5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("main method started");
		for(int i=1;i<=5;i++)
		{
			for(int j=1;j<=i;j++)
			{
				System.out.print(j);
			}
			
				System.out.println(" ");
			}
			System.out.println("main method ended");
		}

	}


